                        "\n\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u062a\u0639\u0647\u062f \u0628\u0647 \u062d\u0641\u0638 \u067e\u0627\u06cc\u062f\u0627\u0631\u06cc \u0648 \u06a9\u06cc\u0641\u06cc\u062a \u062e\u062f\u0645\u0627\u062a \u062e\u0648\u062f \u0627\u0633\u062a\u060c \u0627\u0645\u0627 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u062f\u0631 \u0634\u0631\u0627\u06cc\u0637 \u062e\u0627\u0635 \u0648 \u062e\u0627\u0631\u062c \u0627\u0632 \u06a9\u0646\u062a\u0631\u0644 (\u0646\u0638\u06cc\u0631 \u0633\u06cc\u0644\u060c \u0632\u0644\u0632\u0644\u0647\u060c \u0642\u0637\u0639\u06cc \u0627\u06cc\u0646\u062a\u0631\u0646\u062a\u060c \u0627\u062e\u062a\u0644\u0627\u0644\u0627\u062a \u0632\u06cc\u0631\u0633\u0627\u062e\u062a\u06cc \u06cc\u0627 \u062d\u0648\u0627\u062f\u062b \u063a\u06cc\u0631\u0645\u062a\u0631\u0642\u0628\u0647) \u0627\u0631\u0627\u0626\u0647 \u0628\u0631\u062e\u06cc \u062e\u062f\u0645\u0627\u062a \u0628\u0627 \u0627\u062e\u062a\u0644\u0627\u0644 \u06cc\u0627 \u062a\u0648\u0642\u0641 \u0645\u0648\u0642\u062a \u0645\u0648\u0627\u062c\u0647 \u0634\u0648\u062f. \u06a9\u0627\u0631\u0628\u0631 \u0628\u0627 \u067e\u0630\u06cc\u0631\u0634 \u0627\u06cc\u0646 \u0634\u0631\u0627\u06cc\u0637\u060c \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0631\u0627 \u0628\u0627\u0628\u062a \u0622\u062b\u0627\u0631 \u0646\u0627\u0634\u06cc \u0627\u0632 \u0627\u06cc\u0646 \u0648\u0642\u0641\u0647\u200c\u0647\u0627 \u0645\u0633\u0626\u0648\u0644 \u0646\u0645\u06cc\u200c\u062f\u0627\u0646\u062f.\n\n"
